import Button from "react-bootstrap/Button";

import Card from "react-bootstrap/Card";
import Form from "react-bootstrap/Form";
import Alert from "react-bootstrap/Alert";
import { Stack } from "react-bootstrap";
import { Table } from "react-bootstrap";
import { Row } from "react-bootstrap";

function ShelterBooking() {
  const styles = {
    tbl: {
      width: "40vw",
    },
  };
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <Card style={{ width: "30rem" }}>
          <Alert>
            <Alert.Heading className="d-flex justify-content-center">
              BED BOOKING
            </Alert.Heading>
            <div className="d-flex justify-content-end pt-3">
              Victim Id:1212
            </div>
          </Alert>

          <Form className="mt-1 p-3">
            <b>Dear Alex Peterson (4545456)</b>
            <p>
              Thank You, for using our online portal. Your Booking details are
              indicated below.
            </p>
            <br></br>
            <Row>
              <Col sm={6}>
                <Card.Img
                  style={styles.cardImg}
                  src={require("../../images/rescue.png")}
                />
              </Col>

              <Col sm={6}>
                <div>
                  <Form className="mt-1 p-3">
                    <Stack direction="horizontal" gap={5}>
                      <div>
                        <b>Address :</b> 45456{" "}
                      </div>
                      <div>
                        <b>Contact Details:</b> 22/06/2022
                      </div>
                    </Stack>
                  </Form>
                </div>
              </Col>
            </Row>

            <div className="d-flex justify-content-center mt-5">
              <Button variant="primary" type="submit">
                Print
              </Button>
            </div>
          </Form>
        </Card>
      </div>
    </>
  );
}

export default ShelterBooking;
